window.bookSummaryJSON = "<p>Adri Paige is too busy dealing with the emotional fallout from losing half of her family to deal with boys. At least she thought so until the two most intriguing guys in her new school take an interest in her. </p> <p>Both boys are gorgeous and blessed with obscene amounts of money. They should have the emotional depth of note cards, but instead display undercurrents she doesn't fully understand. Rumors the pair destroys peoples' livelihoods seem ludicrous until she gets caught in the crossfire and her family almost loses their home. She's increasingly unsure either boy is really human, and their rivalry is rapidly turning deadly.</p>"; 
